import RMDBLogo from '../images/reactMovie_logo.png'


const StyledHeader = styled.div`
    background: #1c1c1c;
    padding: 0 20px;
    box-sizing: border-box;

    .header-content {
        max-width: 1280px;
        min-height: 120px;
        padding: 20px 0;
        margin: auto;
        box-sizing: border-box;
        @media screen and (max-width: 500px) {
            min-height: 0px
        }
    }
`
const Header = () => (
    <>
    <div>
        <div className='header-content'>
            {/* <image src={} alt='rmdb-logo' />
            <image src={} alt='tmdb-logo' /> */}
        </div>
    </div>
    </>
)

export default Header
